<p style="font-size:140%;font-family: 'Bubbler One', sans-serif;"> Alexis Chu is a senior at Burlingame High School. The following year she will be attending Syracuse University where she will be double majoring in forensic science and biology. Alexis became involved with computer science when her friend suggested that she join the girls who code club offered at her school. As Alexis gained more interest in coding, she decided to apply to the girls who code summer immersion program. That summer Alexis, along with 19 other girls, attended the summer immersion program at Intuit where they learned HTML, C++, Java, Python, and many more languages. Because of girls who code, Alexis became aware of the minority of women in STEM and knew that she wanted to encourage more females to join STEM careers. In her free time, Alexis enjoys hanging out with friends to eat instagram worthy food. Her favorite place to eat is Mints and Honey. Additionally, she is apart of band. Alexis plays the clarinet in marching band, wind ensemble, and the orchestra for the school musicals. When Alexis is not playing her instrument or hanging out with her friends, she loves to bake, listen to music, take naps, and travel with her family.</p>
